      <input type="text" id="lname" name="lname" />
      <br />
      <label for="fname">Password:</label>
      <br />
      <input type="text" id="fname" name="fname" />
      <button className="btn" type="submit">
        Submit
      </button>
      <form />
    </div>
  );
}
